// n8n Code node (JavaScript)
// Robustly adds: json.firstName, json.business, json.parseConfidence
// Handles missing/undefined fields safely.

function S(v) {
  // Always return a string; never undefined/null
  if (v === undefined || v === null) return "";
  return (typeof v === "string") ? v : String(v);
}

function T(v) {
  return S(v).trim();
}

function pick(obj, keys) {
  for (const k of keys) {
    const val = T(obj?.[k]);
    if (val) return val;
  }
  return "";
}

function firstNameFrom(fullName = "") {
  let s = T(fullName);
  if (!s) return "";

  // "Last, First" -> "First Last"
  if (s.includes(",")) {
    const parts = s.split(",").map(p => T(p)).filter(Boolean);
    if (parts.length >= 2) s = `${parts[1]} ${parts[0]}`;
  }

  // strip common titles/suffixes
  s = S(s)
    .replace(/\b(Dr|Mr|Ms|Mrs|Prof)\.?\b/ig, "")
    .replace(/\b(Jr|Sr|II|III|IV|PhD|MD|MBA)\b\.?/ig, "")
    .replace(/\s{2,}/g, " ")
    .trim();

  return s.split(/\s+/)[0] || "";
}

function stripEmojiAndPunctStart(s = "") {
  return S(s).replace(/^[^\p{L}\p{N}]+/u, "").trim();
}

function trimRoleTail(phrase = "") {
  const tails = [
    "Practice Management", "Practice Manager", "Marketing", "Sales",
    "Engineering", "Operations", "Consulting", "Consultant",
    "Manager", "Director", "Specialist", "Coordinator", "Assistant",
    "Head", "Lead"
  ];
  let p = T(phrase);
  for (const t of tails) {
    const re = new RegExp(`\\b${t}\\b\\s*$`, "i");
    if (re.test(p)) {
      p = p.replace(re, "").trim();
      break;
    }
  }
  return p.replace(/\s{2,}/g, " ").trim();
}

function extractCompanyFromTitle(raw = "") {
  const title = stripEmojiAndPunctStart(T(raw).replace(/\u2026|\.\.\.$/g, ""));
  if (!title) return { company: "", confidence: 0 };

  // 1) " at " / " @ " / " of "
  let m = title.match(/\b(?:at|@)\b\s*([A-Z][\w&'.()/-]*(?:\s+[A-Z0-9][\w&'.()/-]*)*)/i);
  if (m) return { company: T(m[1]), confidence: 0.95 };

  m = title.match(/\b(?:of)\b\s*([A-Z][\w&'.()/-]*(?:\s+[A-Z0-9][\w&'.()/-]*)*)/i);
  if (m) return { company: T(m[1]), confidence: 0.82 };

  // 2) Role – sep – Company  OR  Company – sep – Role
  const sep = "[–—-]|\\||·|•|,|:";
  const reAfter = new RegExp(`^[^${sep}]+(?:${sep})\\s*([A-Z][A-Za-z0-9&'.()/-]*(?:\\s+[A-Z0-9][A-Za-z0-9&'.()/-]*)*)$`);
  const reBefore = new RegExp(`^([A-Z][A-Za-z0-9&'.()/-]*(?:\\s+[A-Z0-9][A-Za-z0-9&'.()/-]*)*)(?:\\s*${sep}\\s*)[^${sep}]+$`);
  m = title.match(reAfter);
  if (m) return { company: T(m[1]), confidence: 0.75 };
  m = title.match(reBefore);
  if (m) return { company: T(m[1]), confidence: 0.72 };

  // 3) Parentheses
  m = title.match(/\(([^)]+)\)/);
  if (m && /[A-Za-z]/.test(S(m[1]))) return { company: T(m[1]), confidence: 0.65 };

  // 4) Fallback: leading capitalized chunk, then trim role tails
  const lead = title.match(/^([A-Z][\w&'.()/-]*(?:\s+[A-Z][\w&'.()/-]*){0,7})/);
  if (lead) {
    const guess = trimRoleTail(lead[1]);
    if (guess) return { company: guess, confidence: 0.55 };
  }

  return { company: "", confidence: 0 };
}

function extractCompanyFromSnippet(snippet = "") {
  const s = T(snippet).replace(/\u00b7/g, "·");
  if (!s) return { company: "", confidence: 0 };

  // Experience: <Company> …
  let m = s.match(/Experience:\s*([^·\n,]+(?: [A-Z][^·\n,]+)*)/i);
  if (m) return { company: T(m[1]), confidence: 0.9 };

  // Works/Worked at <Company>
  m = s.match(/\bWorks? (?:at|with)\s+([^·\n,]+(?: [A-Z][^·\n,]+)*)/i);
  if (m) return { company: T(m[1]), confidence: 0.85 };

  // Try to capture a recent company line like "818 Dental. Nov 2022 - ..."
  m = s.match(/([A-Z][A-Za-z0-9&'.()/-]*(?:\s+[A-Z0-9][A-Za-z0-9&'.()/-]*)*)\.\s*(?:Jan|Feb|Mar|Apr|May|Jun|Jul|Aug|Sep|Oct|Nov|Dec)\s+\d{4}\s+-/);
  if (m) return { company: T(m[1]), confidence: 0.75 };

  // Role ... at <Company>
  m = s.match(/\b(Manager|Director|Engineer|Consultant|Founder|CEO|COO|CFO|Head|Lead|Partner|Owner)\b.*?\bat\s+([^·\n,]+(?: [A-Z][^·\n,]+)*)/i);
  if (m) return { company: T(m[2]), confidence: 0.8 };

  // Weak fallback: "for <Company>"
  m = s.match(/\bfor\s+([A-Z][A-Za-z0-9&'.()/-]*(?:\s+[A-Z0-9][A-Za-z0-9&'.()/-]*)*)/);
  if (m) return { company: T(m[1]), confidence: 0.45 };

  return { company: "", confidence: 0 };
}

function extractBusiness(j) {
  // direct fields first
  const direct = pick(j, ["company", "business", "organization", "employer", "org", "currentCompany"]);
  if (direct) return { company: direct, confidence: 1 };

  // title/headline
  const titleLike = pick(j, ["title", "headline", "jobTitle", "role", "position"]);
  const fromTitle = extractCompanyFromTitle(titleLike);
  if (fromTitle.company) return fromTitle;

  // snippet/bio
  const snippetLike = pick(j, ["snippet", "bio", "summary", "about"]);
  const fromSnippet = extractCompanyFromSnippet(snippetLike);
  if (fromSnippet.company) return fromSnippet;

  return { company: "", confidence: 0 };
}

return items.map(item => {
  const j = item?.json ?? {};
  const fullName = pick(j, ["name", "fullName", "FullName", "personName"]);
  const firstName = firstNameFrom(fullName);

  const { company, confidence } = extractBusiness(j);

  return {
    json: {
      ...j,
      firstName,
      business: company,
      parseConfidence: confidence
    }
  };
});
